'If you don\'t want to use the standard signup form, you can use pure HTML signup form. Just copy & paste the code below to a HTML page and you have fully customizable signup form.'=>'Hvis du ikke ønsker å bruke standard registrerings skjema, kan du bruke ren HTML registrerings skjema. Kopier & lim inn koden nedenfor på en HTML side og du har fullt konfigurerbar registrerings skjema',
'Debugging can be used for troubleshooting. If you turn it on, the system will log every action to your History log. You can use these messages to investigate the flow of commands, and to find out what is wrong. This way you can check what are the scripts doing and where exactly they fail. In production it should be turned off, because it generates multiple history records for each transaction and slows down the system.'=>'Debugging kan bli brukt for problemløsning. Hvis du skrur den på vil systemet føre logg for hver handling i din Historie logg. Du kan bruke disse meldingene for å etterforske flyten av kommandoene og finne hva som er feil. Dette er måten du kan sjekke hva scriptene gjør og hvor feilen ligger eksakt. I produkasjon bør de være slått av pga. at den genererer flere historie opptak for hver transaksjon og senker ned farten på systemet.',
'You can automatically send email about payment to the affiliates.<br/>The email is generated using the \'On affiliate payout\' template.'=>'Du kan automatisk sende email om betaling til affiliatene.<br/>Email er generert ved bruk av \'På affiliate utbetaling\' template.',
