'Action commissions'=>'Handling provisjoner',
'Action Commissions feature allows you to define per action, or per "anything" commissions.<br/>This way you can define commissions for example per user registration, per download, per visiting specific page, etc.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Handling kommisjon tjenesten lar deg definere per handling eller per "hvasomhelst" provisjoner.<br/>På denne måten kan du definere provisjoner f.eks per bruker registrering, per nedlasting, per besøking av spesifikk side, osv.<br/><a href="%s" target="_blank">Mere hjelp i vår Kunnskaps Base</a>',
'More help in our Knowledge Base'=>'Mere hjelp i vår Kunnskapsebase',
'Banner rotator is a special type of banner that rotates other banners.<br/>When affiliate inserts rotator to his page, the rotator displays banners that are assigned to the rotator, so the visitor will see another banner every time he visits the affiliates page.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Banner rotator er en spesiell type banner som roterer andre bannere.<br/>Når affiliate setter inn rotator til en side, vil rotatoren vise bannere som er tilknyttet rotatoren, så besøker vil se annen banner hver gang han besøker affiliates side.<br/><a href="%s" target="_blank">Mere hjelp i vår Kunnskapsbase</a>',
'Branding free'=>'Gratis merkevare',
'Branding Free is a special feature that allows you to change the links in the footer of panels and signup form from "Powered by %s" to your own text and link.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Gratis merkevare er en spesiell tjeneste som lar deg endre linken i footer på panels og registreringsskjema fra "Powered by %s" til din egen tekst og link.<br/><a href="%s" target="_blank">Mere hjelp i vår Kunnskapsbase</a>',
'Commission Groups'=>'Provisjons Grupper',
'Commission groups allow you to set different commissions for different users for the same campaign.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Provisjons Grupper lar deg sette forskjellige provisjoner for forskjellige brukere i samme kampanje.<br/><a href="%s" target="_blank">Mere hjelp i vår Kunnskapsbase</a>',
'CPM commissions'=>'CPM provisjoner',
'CPM (cost per mille) commissions are a special type of commissions that are rewarded for 1000 impressions, which means for displaying your banners 1000 times.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'CPM (kostnads promille) provisjoner er spesiell type provisjoner som belønner hver 1000 visninger, som betyr vising av dine bannere 1000 ganger.<br/><a href="%s" target="_blank">Mere hjelp i vår Kunnskapsbase</a>',
'Forced matrix allows you to limit to the number of referrals of subaffiliates any affiliate can refer. It means that every affiliate can have only specified number of children. <a href="%s" target="_blank">More details read in our Knowledge Base</a>'=>'Tvunget matrix lar deg begrense antallet refererere av under-affiliater enhver affiliate kan referere. Det betyr at hver affiliate har kun et spesifikk antall unger. <a href="%s" target="_blank">Mere detaljer les vår Kunnskapsebase</a>',
'Hosting of %s on  %s servers.'=>'Hosting av %s på  %s servere.',
'Multiple currencies allow you to track sales in multiple currencies.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Flere valutaer lar deg følge salg i flere valutaer.<br/><a href="%s" target="_blank">Mere hjelp i vår Kunnskapsbase</a>',
'Multiple merchants'=>'Flere grossister',
'By default, all campaigns in %s are public, which means that all affiliates can view and promote them. Private campaigns feature allows you to create private campaigns, which will be visible only to selected affiliates.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Som Standard er alle kampanjer i %s offentlig, noe som betyrat alle affiliater kan se og promotere dem. Privat kampanje tjeneste lar deg opprette private kampanjer, som vil være synlig kun for utvalgte affiliater.<br/><a href="%s" target="_blank">More help in our Knowledge Base</a>',
'It alows you to create a special type of promo materials - rebrandable e-books. You can create your PDF e-book only once and upload it to %s.Your affiliates will automatically get their own re-branded copy of the book, with their name, affiliate links, texts, etc. There is no need to run any Windows program for branding, they will simply download rebranded PDF. All the rebranding is made automatically in the background.<br/><a href="%s" target="_blank">%s</a>'=>'Den lar deg opprette en spesiell type promo materialer - videreførings merkevare e-bøker. Du kan lage din PDF e-book kun èn gang og laste den til %s. Dine affiliater vil automatisk få deres egen kopi av denne videreførings merkevare e-boken, med deres navn, affiliate linker, tekster, osv. Det er ingen nødvendighet å kjøre Windows program for merkevarering, de vil simpelthen laste ned videredelings merkevare PDF. Alle videredelings merkevare er gjort automatisk i bakgrunnen.<br/><a href="%s" target="_blank">%s</a>',
'Recurring commissions allow you to reward your affiliates for recurring payments, for example for hosting or membership. <br/><a href="%s" target="_blank">More help in our Knowledge Base</a>'=>'Tilbakevendende provisjoner lar deg belønne dine affiliater for gjentakende betalinger, f.eks for hosting eller medlemskap. <br/><a href="%s" target="_blank">Mere hjelp i vår Kunnskapsbase</a>',
