'It is possible to use following values in ID: {9} - will be replaced by any character in range [0-9], {z} - will be replaced by any character in range [a-z], {Z} - will be replaced by any character in range [A-Z], {X} - will be replaced by any character in range [0-9a-zA-Z], all other characters will be copied to refid as you will specify in format. Example of good format is e.g. {ZZZ}-{XXXXX}-{999}'=>'Det er ikke mulig å bruke følgende verdier i ID: {9} - vil bli erstatter med enhver tall [0-9], {z} - vil bli erstatter med enhver bokstav [a-z], {Z} - vil bli erstatter med enhver bokstav [A-Z], {X} - vil bli erstatter med enhver tegn [0-9a-zA-Z], alle andre tegn vil bli kopiert til refid som du spesifiserer i skjemaet. Eksempel på et godt format er f.eks. {ZZZ}-{XXXXX}-{999}',
'Refid format saved'=>'Refid format lagret',
'Refid must be in format "%s". Format definition: {9} - will be replaced by any character in range [0-9], {z} - will be replaced by any character in range [a-z], {Z} - will be replaced by any character in range [A-Z], {X} - will be replaced by any character in range [0-9a-zA-Z], all other characters will be unchanged. Example of good format is e.g. {ZZZ}-{XXXXX}-{999}'=>'Refid må være i format "%s". Format definisjon: {9} - vil bli erstatter med enhver tall [0-9], {z} - vil bli erstatter med enhver bokstav [a-z], {Z} - vil bli erstatter med enhver bokstav [A-Z], {X} - vil bli erstatter med enhver tegn [0-9a-zA-Z], alle andre tegn vil være uforandret. Eksempel på et godt format er f.eks. {ZZZ}-{XXXXX}-{999}',
